var convertData = function (data) {
  var res = [];
  for (var i = 0; i < data.length; i++) {
    var geoCoord = geoCoordMap[data[i].name];
    if (geoCoord) {
      res.push({
        name: data[i].name,
        value: geoCoord.concat(data[i].value)
      });
    }
  }
  return res;
};
function gettime() {
	$.ajax({
		url: "/time",
		timeout: 10000, //超时时间设置为10秒；
		success: function(data) {
			$("#tim").html(data)
		},
		error: function(xhr, type, errorThrown) {

		}
	});
}

function get_c1_data() {
	$.ajax({
		url: "/c1",
		success: function(data) {
			$(".num h1").eq(0).text(data.num);
			$(".num h1").eq(1).text(data.time);
			$(".num h1").eq(2).text(data.passenger);
			$(".num h1").eq(3).text(data.truck);
		},
		error: function(xhr, type, errorThrown) {

		}
	})
}
function get_c2_data() {
    $.ajax({
        url:"/c2",
        success: function(data) {

			ec_center_option.series[0].data=convertData(data.data)
            ec_center.setOption(ec_center_option)
		},
		error: function(xhr, type, errorThrown) {

		}
    })
}

function get_l1_data() {
    $.ajax({
        url:"/l1",
        success: function(data) {
        	ec_left1_Option.title[1].text=data.time
        	ec_left1_Option.yAxis.data=data.name
			ec_left1_Option.series[0].data=data.data.slice()
			ec_left1_Option.series[0].data=data.data.slice()
            ec_left1.setOption(ec_left1_Option)
		},
		error: function(xhr, type, errorThrown) {

		}
    })
}

function get_l2_data() {
    $.ajax({
        url:"/l2",
        success: function(data) {
			ec_left2_Option.xAxis[0].data=data.time
            ec_left2_Option.series[0].data=data.num_p
            ec_left2_Option.series[1].data=data.num_t
            ec_left2_Option.series[2].data=data.num
            ec_left2.setOption(ec_left2_Option)
		},
		error: function(xhr, type, errorThrown) {

		}
    })
}

function get_r1_data() {
    $.ajax({
        url: "/r1",
        success: function (data) {
            ec_right1_option.yAxis.data=data.name
            ec_right1_option.series[0].data=data.values_p;
            ec_right1_option.series[1].data=data.values_t;
            ec_right1.setOption(ec_right1_option);
        }
    })
}
function get_r2_data() {
    $.ajax({
        url: "/r2",
        success: function (data) {
            ec_right2_option.legend.data=['一型车(客)','一型车(货)', '六型车(货)', '二型车(货)',  '三型车(货)', '五型车(货)','四型车(货)', '四型车(客)','二型车(客)','三型车(客)']
            ec_right2_option.series[0].data=data;
            ec_right2.setOption(ec_right2_option);
        }
    })
}
